import React, { useEffect, useState } from "react";
import "./App.css";
import logo from "./images/plsalogo.jpg";
import { ConnectButton } from "web3uikit";


const App = () => {

  const {btc, setBtc} = useState(50)

  return (
    <>
     <div className="header">
       <div className="logo">
         <img src={logo} alt="PulseAppsLogo" height="50px"/>
         PulseApps
       </div>
       <ConnectButton />
     </div>
     <div className="instructions">
       What are your sentiments about these Cryptos Projects? Green or Red ?
     </div>
     <div className="instructions">PulseApps team use your votes to decide listing of Projects on PulseAppstore</div>

     <Coin 
     perc={btc}
     setPerc={setBtc}
     token={"BTC"}
     />
    </>
  );
};

export default App;
